import Nav from './components/Nav'
import Home from './pages/Home'

import { BrowserRouter, Routes, Route } from 'react-router-dom'

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Nav />
        <Routes>
          {/* <Route path="/">{<Home />}</Route> */}
          <Route path="/" ref={<Home />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
